import htmx from"htmx";async function stub(){}function formatToLocalTime(){stub().then(function(){let e=document.getElementsByClassName("js-date-local");for(let n of e){let t=new Date(n.innerHTML);if(isNaN(t.getTime())||t.toString()==="Invalid Date"||t.getTime()===0)return;n.innerHTML=t.toLocaleString()}}).then(function(){let e=document.getElementsByClassName("js-date-local");for(let t of e)t.classList.remove("js-date-local")})}async function clearNavActive(){let e=document.getElementsByClassName("nav-item");for(let t of e)t.classList.remove("nav-item-active")}function addNavActive(){let e=document.getElementById("tag-update");e!==null&&clearNavActive().then(function(){if(e.dataset.tag===0[0]||e.dataset.tag==="")return;let t=document.getElementById(e.dataset.tag);t!==null&&t.classList.add("nav-item-active")}).then(function(){e.remove()})}htmx.onLoad(function(){formatToLocalTime(),addNavActive()})